VALUES ('3473710041040', 'Limonade', 'Eau de source gazéifiée, sucre, acidifiant : acide citrique, arômes naturels de citron-citron vert et diautres agrumes, Informations nutritionnelles : Valeurs énergétiques moyennes pour 100mL : Energie 153kJ (36kcal) Matières grasses Og Dont acides gras saturés Og Glucides 9g Dont sucres 9g - Protéines Og - Sel o.01g Conserver verticalement à l\'abri de la lumière dans un endroit propre, sec et tempéré. Après ouverture, à conserver au réfrigérateur et à consommer dans les 3 jours. DLUO : voir sur l\'étiquette face en avant C\'est en 1872 que la famille Blanc stinstalle à Vonnas. Pendant trois générations Jean-Louis, Adolphe, Jean et leurs épouses vont être à la fois aubergistes et fabricants de limonade. Georges Blanc, petit fils dAdoIphe, tient aujourd\'hui le Restaurant de Vonnas de réputation mondiale. En hommage à ses aïeux limonadiers et avec la complicité de la Source Lisbeth, il a pu retrouver les saveurs de son enfance limonade à l\'ancienne préparée selon la recette originale d\'Adolphe PENSEZ BOUTEILLE VERRE ET SON RECYCLER pouvant varier localement 3 473710 041040 uniquement pour la France Par SOFRAb1p - 01540 VONNAS', '', '0', '0', '9', '9', '', '0', '0.01', '0.00393700787401575', '', '1');

